const SideMenu = () => {
  return (

        <div className='side_menu_box'>
            <ul className='side_menu_list'>
                <li className='side_menu_menu1'>리스트</li>
                <li className='side_menu_menu2'>챗창</li>
                <li className='side_menu_menu3'>설정</li>
            </ul>
        </div>

  )
}

export default SideMenu
